Data can have at most one mutable reference: fn main() { let mut s = String::from("hello"); change(&mut s);
} fn change(some_string: &mut String) { some_string.push_str(", world");
} This restriction prevents data races: Two or more pointers access the same data at the same time. At least one of the pointers is being used to write to the data. Thereâ€™s no mechanism being used to synchronize access to the data. Creating a new scope with curly brackets allows for multiple mutable references, just not simultaneous ones: let mut s = String::from("hello"); { let r1 = &mut s; } // r1 goes out of scope here, so we can make a new reference with no problems. let r2 = &mut s; However, you cannot have a a mutable reference while also having an immutable one, unless all immutable references are out of scope: let mut s = String::from("hello"); let r1 = &s; // no problem let r2 = &s; // no problem println!("{} and {}", r1, r2); // r1 and r2 are no longer used after this point let r3 = &mut s; // no problem println!("{}", r3);

