A string slice is a reference to part of a String. let s = String::from("hello world"); let hello = &s[0..5]; let world = &s[6..11]; Starting and trailing indices are optional: let s = String::from("hello"); let slice = &s[0..2];
let slice = &s[..2]; let slice = &s[3..len];
let slice = &s[3..]; let slice = &s[0..len];
let slice = &s[..]; Example function returning string slice, &str: fn first_word(s: &String) -> &str { let bytes = s.as_bytes(); for (i, &item) in bytes.iter().enumerate() { if item == b' ' { return &s[0..i]; } } &s[..]
} Where enumerate returns a tuple of i and &item

