Methods are defined within impl blocks. Structs can have multiple impl blocks. struct Rectangle { width: u32, height: u32,
} impl Rectangle { fn area(&self) -> u32 { self.width * self.height }
} fn main() { let rect1 = Rectangle { width: 30, height: 50, }; println!( "The area of the rectangle is {} square pixels.", rect1.area() );
} Rust uses automatic referencing and dereferencing when calling methods. When you call a method with object.something(), Rust automatically adds in &, &mut, or * so object matches the signature of the method. p1.distance(&p2);
(&p1).distance(&p2); Automatic referencing works because methods have a clear receiverâ€”the type of self . Given the receiver and name of a method, Rust can figure out definitively whether the method is reading ( &self ), mutating ( &mut self ), or consuming ( self ).

