Defining Enums enum IpAddrKind { V4, V6,
} Variations of enums are namespaced under their identifier. let four = IpAddrKind::V4; let six = IpAddrKind::V6; Enum Associated Values enum IpAddr { V4(String), V6(String), } let home = IpAddr::V4(String::from("127.0.0.1")); let loopback = IpAddr::V6(String::from("::1")); Enum variants can have different types and amounts of associated data. enum IpAddr { V4(u8, u8, u8, u8), V6(String), } let home = IpAddr::V4(127, 0, 0, 1); let loopback = IpAddr::V6(String::from("::1")); or enum Message { Quit, Move { x: i32, y: i32 }, Write(String), ChangeColor(i32, i32, i32),
} Quit has no data associated with it at all. Move includes an anonymous struct inside it. Write includes a single String. ChangeColor includes three i32 values. Methods on Enums impl Message { fn call(&self) { // method body would be defined here } } let m = Message::Write(String::from("hello")); m.call();

